import React from 'react';
import { useLocation } from 'react-router-dom';
import PetCard from './PetCard'; // Import the PetCard component

const LocationSpecificPets = () => {
  const location = useLocation();
  const state = location.state;

  if (!state || !state.data) {
    return <div>No data available</div>; // Handle the case when data is not available
  }

  const { data } = state;

  return (
    <div>
      <h2>Search Results for: {data.searchText}</h2>
      <h3>Pet Type: {data.petType}</h3>
      <div className="pet-card-container">
        {data.pets.map((pet) => (
          <PetCard key={pet.id} pet={pet} />
        ))}
      </div>
    </div>
  );
};

export default LocationSpecificPets;
